def _get_value(case):
    drawers = [v for v in case.views if type(v) is Drawer]
    prismatic_connections = [conn for conn in case.connections if type(conn) is PrismaticConnection]
    cabinets = []
    for pc in prismatic_connections:
        for drawer in drawers:
            if type(pc.parent) is Container and pc.child.name == drawer.container.name:
                current_cabinets_containers = [v.container.name for v in case._original_object.views if type(v) is Cabinet]
                if pc.parent.name not in current_cabinets_containers:
                    cabinets.append(Cabinet(pc.parent, [drawer], world=case._original_object))
                else:
                    existing_cabinet = [v for v in case._original_object.views if type(v) is Cabinet and v.container.name == pc.parent.name][0]
                    if drawer not in existing_cabinet.drawers:
                        existing_cabinet.drawers.append(drawer)

    return cabinets

def _get_value(case):
    has_drawers = len([v for v in case.views if type(v) is Drawer]) > 0
    return has_drawers

def _get_value(case):
    drawers = []
    for conn in case.connections:
        if type(conn) is FixedConnection:
            if type(conn.parent) is Container and type(conn.child) is Handle:
                prismatic_connections = [c for c in case.connections if type(c) is PrismaticConnection]
                for pc in prismatic_connections:
                    if conn.parent is pc.child and type(pc.parent) is Container:
                        drawers.append(Drawer(conn.child, conn.parent, world=case._original_object))

    return drawers
